// src/components/Dashboard.js
import React from 'react';
import Navbar from './Navbar';

function Dashboard() {
  return (
    <div>
      <Navbar />
      <h2>Welcome to the DGE Dashboard</h2>
      <p>Select an action from the menu.</p>
    </div>
  );
}

export default Dashboard;
